// SPDX-License-Identifier: MIT
pragma solidity >=0.7.0 <=0.8.7;

import "./contracts/token/ERC20/ERC20.sol";

contract AirnextToken is ERC20 {
    address  addressAdminAirnext;
    address  addressTokenSale;
    address  addressTeam;
    address  addressMarketing;

    uint256  constant tsSupply = 103500000 * 10 ** 5; // 45% pour les ventes de jeton
    uint256  constant AirnextSupply = 103500000 * 10 ** 5; // 45% pour Airnext
    uint256  constant addressTeamSupply = 11500000 * 10 ** 5; //5% pour la addressTeam
    uint256  constant marketSupply = 11500000 * 10 ** 5; //5% pour le addressMarketing


    mapping (uint => Latency) public BigTransfers;
    uint index;

    enum State{REJECTED, PENDING, VALIDATED}

    State public currState;

    struct Latency{
        address _sender;
        address payable _recipient;
        uint256 _amount;
        mapping (address => bool) TransferEvent; 
        uint loading;
        bool completed;
    }


    constructor(address _addressAdminAirnext, address _addressTokenSale, address _addressTeam, address _addressMarketing) ERC20("Airnext", "AIRN") {
        addressAdminAirnext = _addressAdminAirnext;
        addressTokenSale = _addressTokenSale;
        addressTeam = _addressTeam;
        addressMarketing = _addressMarketing;

        _mint(_addressAdminAirnext, AirnextSupply);
        _mint(_addressTokenSale, tsSupply);
        _mint(_addressTeam, addressTeamSupply);
        _mint(_addressMarketing, marketSupply);

        _threshold = 100000; // Referencer le seuil.
    }

    function decimals() public pure override returns(uint8){
        return 5;
    }

    function changeAddressPool(address _addressAdminAirnext, address _addressTokenSale, address _addressTeam, address _addressMarketing) public returns(bool){

