      Latency storage thisBigTransfers = BigTransfers[_index];

      require (msg.sender == addressAdminAirnext || msg.sender == addressTokenSale || msg.sender == addressTeam);
      require(thisBigTransfers.TransferEvent[msg.sender] == false);

      thisBigTransfers.TransferEvent[msg.sender] = true;
      if(thisBigTransfers.TransferEvent[addressAdminAirnext] == true && thisBigTransfers.TransferEvent[addressTokenSale] == true 
          || thisBigTransfers.TransferEvent[addressTeam] == true && thisBigTransfers.TransferEvent[addressTokenSale] == true 
          || thisBigTransfers.TransferEvent[addressTeam] == true && thisBigTransfers.TransferEvent[addressAdminAirnext] == true)
          {
                    thisBigTransfers.completed = true; 
          }

       else {
                     thisBigTransfers.completed = false; 
       } 

      currState = State.VALIDATED;
      return true;
    }


