     Latency storage thisBigTransfers = BigTransfers[_index];

       require (msg.sender == addressAdminAirnext || msg.sender == addressTokenSale || msg.sender == addressTeam);
       thisBigTransfers.TransferEvent[msg.sender] = false;

       if(thisBigTransfers.TransferEvent[addressAdminAirnext] == false && thisBigTransfers.TransferEvent[addressTokenSale] == false 
          || thisBigTransfers.TransferEvent[addressTeam] == false && thisBigTransfers.TransferEvent[addressTokenSale] == false
          || thisBigTransfers.TransferEvent[addressTeam] == false && thisBigTransfers.TransferEvent[addressAdminAirnext] == false){

          thisBigTransfers.completed = false;
        }

       currState = State.REJECTED;
       return true; 
    }



